import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Advertisement from './Advertisement';
import NavBar from './components/NavBar'

ReactDOM.render(
  <React.StrictMode>
    <Advertisement/>
    <NavBar />
      <br/>
      <div className="pages">
        <Routes>
        </Routes>
        </div>
    <App />
    <Advertisement/>
  </React.StrictMode>,
  document.getElementById('root')
);

